INSERT INTO `person_info` VALUES ('186', 'xsx123', '175422850', 'http://www.jiayuan.com/175422850?fxly=search_v2', '北京', '46岁', '朝阳', '46岁，离异，来自北京朝阳', '本科', '160cm', '--', '北京朝阳', '10000～20000元', '--', '天蝎座', '--', '--', '猪', '--', '我是一个善良,开朗,靠谱的人 ，爱好广泛的我，喜欢电影，关于外貌，简单形容就是漂亮，我的工作属于金融业。', '还没有填写个性元素', '还没有填写兴趣爱好', 'http://at3.jyimg.com/af/ff/b09d354ccdbcd2bbbd79bedc431d/b09d354cc_1_avatar_square_p.jpg http://t3.jyimg.com/af/ff/b09d354ccdbcd2bbbd79bedc431d/148293285d.jpg', 'xsx123_175422850', '2018-03-21 16:15:13', '2018-03-21 16:15:13');
INSERT INTO `person_info` VALUES ('187', '小乖乖不乖', '175422864', 'http://www.jiayuan.com/175422864?fxly=search_v2', '重庆', '29岁', '万州', '29岁，未婚，来自重庆万州', '本科', '160cm', '已购车（豪华型）', '重庆万州', '20000～50000元', '已购房（无贷款）', '天秤座', '汉族', '47公斤', '龙', 'O型', '执子之手，白头偕老', '还没有填写个性元素', '羽毛球\n跑步\n网络\n音乐\n中国菜\n电影院\n卡拉OK\n小桥流水人家', 'http://at4.jyimg.com/7b/5a/9ee6143b34514b449e45cef27e05/9ee6143b3_2_avatar_square_p.jpg http://t4.jyimg.com/7b/5a/9ee6143b34514b449e45cef27e05/148302808d.jpg', '小乖乖不乖_175422864', '2018-03-21 16:15:13', '2018-03-21 16:15:13');
INSERT INTO `person_info` VALUES ('188', '年年', '25088345', 'http://www.jiayuan.com/25088345?fxly=cp-eexpress', '湖南', '27岁', '邵阳', '27岁，未婚，来自湖南邵阳显示地图', '本科', '155cm', '暂未购车', '湖南邵阳', '2000～5000元', '与父母同住', '巨蟹座', '汉族', '55公斤', '马', 'B型', '毕业五年了，目前在一家银行工作，不接受长期异地\n\n工作比较轻松，工作氛围也不错。\n\n希望对方性格温和，稳重，有上进心，有孝心\n\n我的性格是活泼，积极向上，乐天派，容易满足，善于发现生活中的美好事物。\n\n我向往的是可以一起散步，一起买菜做饭的家庭温暖。\n\n希望两个人一起奋斗，一起追求平凡的幸福，相濡以沫就好。非诚勿扰。', '还没有填写个性元素', '还没有填写兴趣爱好', 'http://at4.jyimg.com/32/c1/e355725384170e7d0d2fb8d9c24a/e35572538_1_avatar_square_p.jpg http://t4.jyimg.com/32/c1/e355725384170e7d0d2fb8d9c24a/147319757d.jpg', '年年_25088345', '2018-03-21 16:15:13', '2018-03-21 16:15:13');
INSERT INTO `person_info` VALUES ('189', '小红宝', '52725328', 'http://www.jiayuan.com/52725328?fxly=cp-eexpress', '广东', '25岁', '广州', '25岁，未婚，来自广东广州显示地图', '本科', '167cm', '暂未购车', '广东广州', '5000～10000元', '与父母同住', '巨蟹座', '汉族', '54公斤', '猴', '--', '巨蟹座的孩纸：\n\n1、泪点很低，看到感动的画面会不由自主的掉泪；\n\n2、没有人照顾的时候，巨蟹很坚强，但是一旦有人在巨蟹身边，巨蟹就成了孩纸；\n\n3、会幻想家人出事怎么办，想着想着，巨蟹就哭了；\n\n4、有时候喜欢自己一个人散步、逛街。\n\n好吧，这是4年前的我写的，现在回头看，觉得真有点矫情。\n\n现在的我嘛，八个字可以形容，静若处子，动如脱兔。\n\n我喜欢运动，唱K，到处去旅游，也可以安安静静地宅在家里玩游戏，煲剧看小说。\n\n我不会做饭，但我也希望能早日遇到个让我愿意为他学的人。\n\n你不需要和我拥有完全一样的兴趣爱好，我尊重你，也喜欢差异性。但我也希望你能尊重和支持我的的兴趣。\n\n你不需要是高富帅，比我高5cm，有一颗上进的心，愿意包容我，能够带着我一起成长就够了。\n\n我不希望你是一个抽烟嗜酒的人，因为这会对自己和身边的人都带来伤害。\n\n最后，感谢你耐心看完这么长一段话，有缘分的话就来信吧，期待和你相遇~', '还没有填写个性元素', '还没有填写兴趣爱好', 'http://at3.jyimg.com/a7/1a/992f09eaa6a9974ab2563a289833/992f09eaa_4_avatar_square_p.jpg http://t3.jyimg.com/a7/1a/992f09eaa6a9974ab2563a289833/141025431d.jpg http://t3.jyimg.com/a7/1a/992f09eaa6a9974ab2563a289833/140922236d.jpg http://t3.jyimg.com/a7/1a/992f09eaa6a9974ab2563a289833/140919725d.jpg http://t3.jyimg.com/a7/1a/992f09eaa6a9974ab2563a289833/128803131d.jpg http://t3.jyimg.com/a7/1a/992f09eaa6a9974ab2563a289833/98645562d.jpg', '小红宝_52725328', '2018-03-21 16:15:13', '2018-03-21 16:15:13');
INSERT INTO `person_info` VALUES ('190', '一汀烟雨', '42683093', 'http://www.jiayuan.com/42683093?fxly=cp-eexpress', '湖南', '28岁', '长沙', '28岁，未婚，来自湖南长沙', '本科', '159cm', '暂未购车', '湖南长沙', '5000～10000元', '需要时购置', '射手座', '汉族', '45公斤', '蛇', 'O型', '本科毕业多年，一直忙于工作学习，恍然中周围同学朋友都已经结婚生子。平时工作比较忙，喜欢旅游、看书、唱歌等，本人恋爱经历比较简单，希望能找到一个与自己有共同语言，有上进心的男士~~！', '还没有填写个性元素', '足球\n中国菜\n文学\n人文社科\n动作冒险\n政治事件\n体育赛事\n休闲生活', 'http://at3.jyimg.com/66/ce/20a82302b7475641e39fb6d7386d/20a82302b_5_avatar_square_p.jpg http://t3.jyimg.com/66/ce/20a82302b7475641e39fb6d7386d/148215522d.jpg http://t3.jyimg.com/66/ce/20a82302b7475641e39fb6d7386d/147954952d.jpg http://t3.jyimg.com/66/ce/20a82302b7475641e39fb6d7386d/139238825d.jpg http://t3.jyimg.com/66/ce/20a82302b7475641e39fb6d7386d/139219114d.jpg http://t3.jyimg.com/66/ce/20a82302b7475641e39fb6d7386d/139218936d.jpg', '一汀烟雨_42683093', '2018-03-21 16:15:13', '2018-03-21 16:15:13');
