INSERT INTO `person_info` VALUES ('255', '玲玲', '139488117', 'http://www.jiayuan.com/139488117?fxly=cp-eexpress', '湖南', '28岁', '郴州', '28岁，未婚，来自湖南郴州', '大专', '157cm', '暂未购车', '湖南郴州', '5000～10000元', '与父母同住', '白羊座', '汉族', '47公斤', '蛇', 'A型', '情愿把等待的时间拉长一点，也要遇到牵手就是一辈子的，所以找个对的人比什么都重要\n\n希望我们少一点套路，多一些真诚，互相信任，坦诚相待，我坚信，不久的明天，我们将会拥有属于自己的幸福。\n\n大家好：我住郴州市内，在市区工作，我是一个通情达理，遇事能换位思考，对工作认真负责，单纯善良，传统含蓄，有点内向，稍许慢热的姑娘。不喜欢刹那间“激情”与“刺激”的速食主义爱情，崇尚“日久生情”，天长地久”，“小火慢炖”式的爱情。\n\n我希望未来的另一半：人品好，性格好，身体健康，成熟稳重，感情专一，善于沟通，不浮躁，有耐心，有事业心，有一定的自控力和抗压能力，无不良嗜好，在郴州市内有一项谋生的技能，不一定多金，但一定能与我共担养家的责任。\n\n这个世界上总会有个人在等我，愿意包容我的小缺点，小任性，带给我很多快乐，些许浪漫，我们从相识相知，相亲相爱，再牵手一起白头偕老。这个人是你吗？如果是，请给我写信吧，当然，希望你是真实靠谱的，并且确定能让我看到信件的内容（因没有邮票，只能看免费信件，不好意思），非诚勿扰，谢谢。\n\n郑重声明：我的资料和个性标签都是真实的,如果你觉得相互之间符合要求，请给我来信吧，我一定会认真回复，谢谢。\n\n重要的事情讲三遍，重要的事情讲三遍，最后一遍：如果你不是以结婚为目的，请不要给我写信，如果你特喜欢复制模板的内容，那么请不要浪费双方的时间，如果你社会关系复杂，感情经历丰富，请不要给我写信，如果你超级前卫，特别开放，请不要给我写信，如果你是外貌协会或者自认为男神的，请不要给我写信，因为我们根本不在一个频道上。本人不接受离异男士和异地恋，希望你能理解，谢谢。最后祝大家早日寻到自己的幸福。', '还没有填写个性元素', '还没有填写兴趣爱好', 'http://at1.jyimg.com/85/c3/aqb8ec2c979f5678ec3652bb5323/adb8ec2c9_4_avatar_square_p.jpg http://t1.jyimg.com/85/c3/aqb8ec2c979f5678ec3652bb5323/130447405d.jpg http://t1.jyimg.com/85/c3/aqb8ec2c979f5678ec3652bb5323/130447105d.jpg http://t1.jyimg.com/85/c3/aqb8ec2c979f5678ec3652bb5323/125500546d.jpg http://t1.jyimg.com/85/c3/aqb8ec2c979f5678ec3652bb5323/121888405d.jpg http://t1.jyimg.com/85/c3/aqb8ec2c979f5678ec3652bb5323/121888399d.jpg', '玲玲_139488117', '2018-03-21 16:15:17', '2018-03-21 16:15:17');
